    data: |
      SELECT ALL col2, 64 + + - 61 AS col0 FROM tab0 (FORMAT parquet) AS cor0 WHERE - 89 * + col0 NOT IN ( - - 6 - - 86 * col0, col2 / - col0 );
  - name: tab0

outputs:
  - name: q6893.out
    data: |
      10	3
      47	3
      99	3
